import React, { useState } from 'react';
import { TouchableOpacity, Button, SafeAreaView, StyleSheet, Text, TextInput, View } from 'react-native';
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';
import Coin from 'react-native-vector-icons/FontAwesome5';

export default function Store(props) {
    function storeClick() {
        alert('already in store!');
    }
    function alarmsClick() {
        props.navigation.navigate("Alarms");
    }
    function profileClick() {
        alert('clicked on profile');
    }
    return (
        <View style={styles.container}>
            <View style={styles.topContainer}>
                <TouchableOpacity onPress={storeClick} style={styles.button}>
                    <Icon color="#e1e1e1" name="shopping-outline" size={25} />
                </TouchableOpacity>
                <TouchableOpacity onPress={alarmsClick} style={styles.button}>
                    <Icon color="#e1e1e1" name="clock-outline" size={25} />
                </TouchableOpacity>
                <Coin color="#C7F0DB" name="coins" style={{ marginLeft: 60 }} size={15} />
                <Text style={{ color: '#C7F0DB', marginLeft: 6 }}>+150</Text>
                <TouchableOpacity onPress={profileClick} style={styles.profilebutton}>
                    <Icon color="#e1e1e1" name="account-circle-outline" size={25} />
                </TouchableOpacity>
            </View>
            <View style={styles.mainPage}>
                <Text>Store screen</Text>
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        display: 'flex',
        flex: 1,
        flexDirection: 'column',
        marginTop: 25
    },
    topContainer: {
        flex: 1,
        alignItems: 'center',
        display: 'flex',
        flexDirection: 'row',
        height: 40,
        maxHeight: 60,
        width: '100%',
        backgroundColor: '#333456'
    },
    mainPage: {
        backgroundColor: '#333456',
        display: 'flex',
        flex: 1
    },
    button: {
        width: 60,
        height: 40,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 5,
        marginLeft: 20,
        color: '#e1e1e1',
    },
    profilebutton: {
        width: 60,
        height: 40,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        borderRadius: 5,
        marginLeft: 20,
        color: '#e1e1e1'
    },
    buttonText: {
        fontSize: 15,
        color: '#e1e1e1'
    }
})
